// create JSON payload to update startWorkDate
idVal = job.prop("id");
newTS = new Date();
formattedTS = newTS.toISOString().slice(0,-5)+"Z";  // slice removes milliseconds and adds back the Z
rawNode = S("{"id": " + idVal + ","startWorkDate": "" + formattedTS + "", "endWorkDate": null}");
jsonNode_out = rawNode.toString().replace("\"", """);
//print(jsonNode_out);
jsonNode_out

// create JSON payload to update status
idVal = job.prop("id");
rawNode = S("{"id": " + idVal + ","status": "" + jobStatus + ""}");
jsonNode_out = rawNode.toString().replace("\"", """);
//print(jsonNode_out);
jsonNode_out

// Unpack vars and set up jobStatus
//
execution.setVariable("action", "pick");
//
// set vars for start and end timestamps
ts= new Date();
formattedTS = ts.toISOString();
execution.setVariable("startWorkDate", formattedTS);
job.prop("startWorkDate", execution.getVariable("startWorkDate"));
execution.setVariable("endWorkDate", null);
e = execution.getVariable("endWorkDate");
if (typeof(e)=="string") {    // only update endWorkDate if it"s not null; otherwise we get indeterminacy error
 job.prop("endWorkDate", e);  // timestamps are saved in the JSON as strings
}
//
execution.setVariable("messageCount", 0);  // number of times the DMN has been evaluated 
//
// Unpack desiredMsg var.  This is the msg to be sent back to the calling workflow when this job is completed
desiredMsg = job.prop("desiredMsg").toString();
desiredMsg = desiredMsg.slice(1, -1);
execution.setVariable("desiredMsg", desiredMsg);
//
// Initialize comm vars
execution.setVariable("materialOpOrder", 1);
execution.setVariable("quantityPickPut", -1);
//
// Initialize location-related vars
execution.setVariable("goToLocation", "");
//
// Initialize vars for DMN comm and reference
execution.setVariable("recordItemStatus", false);  // when true, workflow must record results of the current pick
execution.setVariable("assignee", "");  // user who claims the job
execution.setVariable("original_assignee", "");  // to detect any changes in assignee
execution.setVariable("relinquishJob", false);
//
// initialize internal vars
execution.setVariable("jobStatus", "Unclaimed");
id = job.prop("id");
orderId = id.prop("orderId").value();
workId = id.prop("workId").value();
priority = job.prop("priority").value();
execution.setVariable("priority", priority);
execution.setVariable("workId", workId);
execution.setVariable("orderId", orderId);
//
bk = execution.getProcessBusinessKey();
execution.setVariable("bk", bk);
// must remove "" around calling_bk
calling_bk = job.prop("calling_bk").toString();
calling_bk = calling_bk.slice(1, -1);
execution.setVariable("calling_bk", calling_bk);
// must remove "" around materialListId
mlId = job.prop("materialListId").toString();
mlId = mlId.slice(1, -1);
execution.setVariable("materialListId", mlId);
//
//print("        An instance of WF102 has been initiated to cover pick job", workId, "of order", orderId, "with priority", priority);
jobType = job.prop("workSeqType").value();
execution.setVariable("jobType", jobType);

jobStatus = "Claimed";
assignee = execution.getVariable("assignee");
execution.setVariable("jobStatus", jobStatus);
job.prop("status", jobStatus);
job.prop("assignee", assignee);
execution.setVariable("job", job);
execution.setVariable("original_assignee", assignee);

// create JSON payload to update status
idVal = job.prop("id");
rawNode = S("{"id": " + idVal + ","status": "" + jobStatus + ""}");
jsonNode_out = rawNode.toString().replace("\"", """);
//print(jsonNode_out);
jsonNode_out

// Set up info for a Pick location
// This script sets up information for a generic pick/stow form, so
// we refer the worker to the item"s origin (pick) location.

moo = execution.getVariable("materialOpOrder");  // index of current item within material list
ml = execution.getVariable("materialList");
ml_next = ml.elements().get(moo-1);  // materialOpOrder starts from 1, but javascript indexes from 0

// Set up location
// There are several location options within the material list
goToLocation = ml_next.prop("originLocationId").toString();  // for a pick, items begin at origin location
//goToLocation = ml_next.prop("currentLocationId").toString();
//goToLocation = ml_next.prop("destinationLocationId").toString();
// process goToLocation and save to execution layer
goToLocation = goToLocation.slice(1, -1);  // remove "" in string
execution.setVariable("goToLocation", goToLocation);

// Set up item type and quantity
mmaster = ml_next.prop("materialMaster");
mmasterId = mmaster.prop("id");
materialNumber = mmasterId.prop("materialNumber").toString();
materialName = mmaster.prop("materialName").toString();
materialDescription = mmaster.prop("materialDescription").toString();
plannedQuantity = ml_next.prop("plannedQuantity").value();
//
execution.setVariable("materialNumber", materialNumber);
execution.setVariable("materialName", materialName);
execution.setVariable("materialDescription", materialDescription);
execution.setVariable("plannedQuantity", plannedQuantity);
execution.setVariable("quantityPickPut", 0);

// Save user pick/put quantity into material list
mTemp = execution.getVariable("materialList");
moo = execution.getVariable("materialOpOrder");
quantityPickPut = execution.getVariable("quantityPickPut");
mTemp.elements().get(moo-1).prop("verifiedQuantity", quantityPickPut);
execution.setVariable("materialList", S(JSON.stringify(JSON.parse(mTemp))));

// Increment materialOpOrder and check whether all items have been completed
maxOpOrder = execution.getVariable("maxOpOrder");
if (moo < maxOpOrder) {
	// there are remaining picks or stows to be done, at other locations
	moo += 1;
	execution.setVariable("materialOpOrder", moo);
} else {
	// all items have been picked or stowed
	execution.setVariable("jobStatus", "Pick/Stow complete");
}

// Set up info for a Pick transfer, which involves moving all items
// to the destination location (which is the same for all items)

moo = execution.getVariable("materialOpOrder");  // index of final item within material list
ml = execution.getVariable("materialList");
ml_next = ml.elements().get(moo-1);  // materialOpOrder starts from 1, but javascript indexes from 0

// Set up location
// There are several location options within the material list
//goToLocation = ml_next.prop("originLocationId").toString();  // for a pick, items begin at origin location
//goToLocation = ml_next.prop("currentLocationId").toString();
goToLocation = ml_next.prop("destinationLocationId").toString();
// process goToLocation and save to execution layer
goToLocation = goToLocation.slice(1, -1);  // remove "" in string
execution.setVariable("goToLocation", goToLocation);

// create JSON payload to update assignee
idVal = job.prop("id");
rawNode = S("{"id": " + idVal + ","assignedTo": "" + assignee + ""}");
jsonNode_out = rawNode.toString().replace("\"", """);
//print(jsonNode_out);
jsonNode_out

// update job status
jobStatus = "Completed";
job.prop("status", jobStatus);
execution.setVariable("jobStatus", jobStatus);
// set completion timestamp
ts= new Date();
formattedTS = ts.toISOString();
execution.setVariable("endWorkDate", formattedTS);
job.prop("endWorkDate", execution.getVariable("endWorkDate"));
// update job variable
execution.setVariable("job", job);

// create JSON payload to update endWorkDate
idVal = job.prop("id");
newTS = new Date();
formattedTS = newTS.toISOString().slice(0,-5)+"Z";  // slice removes milliseconds and adds back the Z
rawNode = S("{"id": " + idVal + ","endWorkDate": "" + formattedTS + "", "startWorkDate": null}");
jsonNode_out = rawNode.toString().replace("\"", """);
//print(jsonNode_out);
jsonNode_out

// create JSON payload to update status
idVal = job.prop("id");
rawNode = S("{"id": " + idVal + ","status": "" + jobStatus + ""}");
jsonNode_out = rawNode.toString().replace("\"", """);
//print(jsonNode_out);
jsonNode_out

// create JSON payload to update verifiedQuantity
idVal = item.prop("id");
vq = item.prop("verifiedQuantity").value();
rawNode = S("{"id": " + idVal + ","verifiedQuantity": " + vq + "}");
jsonNode_out = rawNode.toString().replace("\"", """);
//print(jsonNode_out);
jsonNode_out

// create JSON payload to set currentLocationId to destinationLocationId
idVal = item.prop("id");
cl = item.prop("destinationLocationId").value();
rawNode = S("{"id": " + idVal + ","currentLocationId": "" + cl + ""}");
jsonNode_out = rawNode.toString().replace("\"", """);
//print(jsonNode_out);
jsonNode_out
